import React from 'react';
import PlaceList from '../components/PlaceList';
import { useParams } from 'react-router-dom';
const PLACES = [
   {
      id: 'p1',
      title: 'La Sagrada Familia',
      image:
         'https://images.adsttc.com/media/images/5cff/5ec5/284d/d16d/6a00/1111/large_jpg/1.jpg?1560239805',
      address: 'Carrer de Mallorca, 401, 08013 Barcelona, Spain',
      location: { lat: 41.4030154, ltd: 2.1729796 },
      creator: 'u1',
   },
   {
      id: 'p1',
      title: 'Adams Lookout',
      image:
         'https://i.pinimg.com/736x/e8/5a/a2/e85aa206782131c8f8342e4521a06072.jpg',
      address: 'Overhoeksplein 5, 1031 KS Amsterdam, Netherlands',
      location: { lat: 52.383863, ltd: 4.900161 },
      creator: 'u2',
   },
];
const UserPlaces = () => {
   const userID = useParams().userID;
   const loadedPlaces = PLACES.filter((place) => place.creator === userID);
   return <PlaceList items={loadedPlaces} />;
};

export default UserPlaces;
